// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";

contract DocumentSigning is ERC721 {
    bytes32 public merkleRoot;
    uint256 private _nonce;
    mapping(address => bool) public whitelist;

    constructor(bytes32 _merkleRoot, address[] memory _whitelist) ERC721("DocumentToken", "DT") {
        merkleRoot = _merkleRoot;
        for (uint256 i = 0; i < _whitelist.length; i++) {
            whitelist[_whitelist[i]] = true;
        }
    }

    function isWhitelisted(address _address) public view returns (bool) {
        return whitelist[_address];
    }

    function signDocument(bytes32[] memory _proof) public {
        require(isWhitelisted(msg.sender), "Address is not whitelisted");
        require(MerkleProof.verify(_proof, merkleRoot, bytes32(uint256(uint160(msg.sender)))), "Invalid proof");

        _nonce++;
        uint256 tokenId = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, _nonce)));
        _mint(msg.sender, tokenId);
    }
    function generateMerkleRoot(address _address) public pure returns (bytes32) {
        bytes32 hash = keccak256(abi.encodePacked(_address));
        return hash;
    }

}

